import React from 'react';
import SideBar from './sidebar'
import Intro from './intro'
import Projects from './projects'
import Footer from './footer'
import About from './about'
import './App.css';

function App() {
  return (
    <div className="App" id="home">
      <SideBar />
      <Intro />
      <About />
    <Projects /> 
    <Footer />
      </div>
  );
}

export default App;
